import React from 'react';

function SocialButton(props) {
  	return (
     	 <div className="social-button">
         	<a href="{props.buttonURL}">
         		<img src="{props.buttonImg}" alt="{props.buttonName}" />
         	</a>
      	</div>
  	);
}

export default SocialButton;
